import {theme} from 'docz'
import RouterConfig from "./config/router";
// import 'bootstrap/dist/css/bootstrap-grid.css'
// import './styles/index.less';

const Theme = () => RouterConfig;

const themeConfig = {};

export default theme(themeConfig)(Theme)
